func testAutoStoreToManyRemoveOpAutoCategories(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a AutoStore
	var b, c, d, e AutoCategory

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, autoStoreDBTypes, false, strmangle.SetComplement(autoStorePrimaryKeyColumns, autoStoreColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*AutoCategory{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, autoCategoryDBTypes, false, strmangle.SetComplement(autoCategoryPrimaryKeyColumns, autoCategoryColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	err = a.AddAutoCategories(ctx, tx, true, foreigners...)
	if err != nil {
		t.Fatal(err)
	}

	count, err := a.AutoCategories().Count(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 4 {
		t.Error("count was wrong:", count)
	}

	err = a.RemoveAutoCategories(ctx, tx, foreigners[:2]...)
	if err != nil {
		t.Fatal(err)
	}

	count, err = a.AutoCategories().Count(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 2 {
		t.Error("count was wrong:", count)
	}

	if len(b.R.AutoStores) != 0 {
		t.Error("relationship was not removed properly from the slice")
	}
	if len(c.R.AutoStores) != 0 {
		t.Error("relationship was not removed properly from the slice")
	}
	if d.R.AutoStores[0] != &a {
		t.Error("relationship was not added properly to the foreign struct")
	}
	if e.R.AutoStores[0] != &a {
		t.Error("relationship was not added properly to the foreign struct")
	}

	if len(a.R.AutoCategories) != 2 {
		t.Error("should have preserved two relationships")
	}

	// Removal doesn't do a stable deletion for performance so we have to flip the order
	if a.R.AutoCategories[1] != &d {
		t.Error("relationship to d should have been preserved")
	}
	if a.R.AutoCategories[0] != &e {
		t.Error("relationship to e should have been preserved")
	}
}

func testAutoStoreToOneEmployerUsingEmployer(t *testing.T) {
	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var local AutoStore
	var foreign Employer

	seed := randomize.NewSeed()
	if err := randomize.Struct(seed, &local, autoStoreDBTypes, false, autoStoreColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize AutoStore struct: %s", err)
	}
	if err := randomize.Struct(seed, &foreign, employerDBTypes, false, employerColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize Employer struct: %s", err)
	}

	if err := foreign.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	local.EmployerID = foreign.ID
	if err := local.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	check, err := local.Employer().One(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}

	if check.ID != foreign.ID {
		t.Errorf("want: %v, got %v", foreign.ID, check.ID)
	}

	ranAfterSelectHook := false
	AddEmployerHook(boil.AfterSelectHook, func(ctx context.Context, e boil.ContextExecutor, o *Employer) error {
		ranAfterSelectHook = true
		return nil
	})

	slice := AutoStoreSlice{&local}
	if err = local.L.LoadEmployer(ctx, tx, false, (*[]*AutoStore)(&slice), nil); err != nil {
		t.Fatal(err)
	}
	if local.R.Employer == nil {
		t.Error("struct should have been eager loaded")
	}

	local.R.Employer = nil
	if err = local.L.LoadEmployer(ctx, tx, true, &local, nil); err != nil {
		t.Fatal(err)
	}
	if local.R.Employer == nil {
		t.Error("struct should have been eager loaded")
	}

	if !ranAfterSelectHook {
		t.Error("failed to run AfterSelect hook for relationship")
	}
}

func testAutoStoreToOneSetOpEmployerUsingEmployer(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a AutoStore
	var b, c Employer

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, autoStoreDBTypes, false, strmangle.SetComplement(autoStorePrimaryKeyColumns, autoStoreColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	if err = randomize.Struct(seed, &b, employerDBTypes, false, strmangle.SetComplement(employerPrimaryKeyColumns, employerColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	if err = randomize.Struct(seed, &c, employerDBTypes, false, strmangle.SetComplement(employerPrimaryKeyColumns, employerColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = b.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	for i, x := range []*Employer{&b, &c} {
		err = a.SetEmployer(ctx, tx, i != 0, x)
		if err != nil {
			t.Fatal(err)
		}

		if a.R.Employer != x {
			t.Error("relationship struct not set to correct value")
		}

		if x.R.AutoStores[0] != &a {
			t.Error("failed to append to foreign relationship struct")
		}
		if a.EmployerID != x.ID {
			t.Error("foreign key was wrong value", a.EmployerID)
		}

		zero := reflect.Zero(reflect.TypeOf(a.EmployerID))
		reflect.Indirect(reflect.ValueOf(&a.EmployerID)).Set(zero)

		if err = a.Reload(ctx, tx); err != nil {
			t.Fatal("failed to reload", err)
		}

		if a.EmployerID != x.ID {
			t.Error("foreign key was wrong value", a.EmployerID, x.ID)
		}
	}
}

